import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Avatar from '@material-ui/core/Avatar';
import { deepOrange} from '@material-ui/core/colors';
import {background,avatar} from '../Styles/Background.module.scss';
//import {avatar} from '../Styles/Avatar.module.scss';

const useStyles = makeStyles((theme) => ({
  default: {
    fontSize:theme.spacing(7),
    color: theme.palette.getContrastText(deepOrange[500]),
    backgroundColor: deepOrange[500],
    width: theme.spacing(10),
    height: theme.spacing(10),
  },
}));

export default function LetterAvatars() {
  const classes = useStyles();

  return (
    <div className={background}>
      <Avatar className={classes.default+" "+avatar}>q</Avatar>
      <svg width="16" height="16" viewBox="0 0 16 16" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" class="pen" data-ui-test="pen-svg"><use x="0" y="0" width="16" height="16" xlinkHref="/images/icons/icon_definitions.svg#pen"></use></svg>
    </div>
  );
}
